import React from 'react'
import styled from 'styled-components';
import Container from './Container';

const AlignCenter = styled(Container)`
  color: red;
  text-align:center;
`
export default function Tab2() {
  return (
    <AlignCenter>
      This is tab 2 view
    </AlignCenter>
  )
}
